import { bootstrapApplication } from '@angular/platform-browser';
import { AppComponent } from './app/app.component';
import { provideRouter } from '@angular/router';
import { provideAnimations } from '@angular/platform-browser/animations';
import { provideHttpClient, withInterceptorsFromDi } from '@angular/common/http';
import { importProvidersFrom } from '@angular/core';
import { MatToolbarModule } from '@angular/material/toolbar';
import { MatButtonModule } from '@angular/material/button';
import { MatCardModule } from '@angular/material/card';
import { MatIconModule } from '@angular/material/icon';
const routes = [{
  path: '',
  redirectTo: '/dashboard',
  pathMatch: 'full'
}, {
  path: 'dashboard',
  loadComponent: () => import('./app/dashboard/dashboard.component').then(m => m.DashboardComponent)
}, {
  path: 'contracts',
  loadComponent: () => import('./app/contracts/contracts.component').then(m => m.ContractsComponent)
}, {
  path: 'revenue',
  loadComponent: () => import('./app/revenue/revenue.component').then(m => m.RevenueComponent)
}];
bootstrapApplication(AppComponent, {
  providers: [provideRouter(routes), provideAnimations(), provideHttpClient(withInterceptorsFromDi()), importProvidersFrom(MatToolbarModule, MatButtonModule, MatCardModule, MatIconModule)]
}).catch(err => console.error(err));
